import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Icon } from "semantic-ui-react";
import styled from "@emotion/styled";
import "reset-css";

class Header extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <h1>hello header</h1>
      </div>
    );
  }
}

export default Header;
